import Collapse from "../../components/Collapse/Collapse"; // Import de votre composant Collapse

function Equipements({ equipments }) {
  return (
    <div>
      <Collapse>
        <ul>
          {equipments.map((equipment, index) => (
            <li key={index}>{equipment}</li>
          ))}
        </ul>
      </Collapse>
    </div>
  );
}

export default Equipements;
